import React from "react";
import { Link } from "react-router-dom";
import "../assets/styles/Navbar.css"; // Asegúrate de que esta ruta es correcta
import logo from '../assets/images/logoTecswapProject.png'; // Importa la imagen

export default function Navbar() {
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-primary">
                <div className="container-fluid">
                    <Link className="navbar-brand" to="/">
                        <img src={logo} alt="Wen de trueque" className="navbar-logo" />
                    </Link>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <Link className="btn btn-outline-light" to="/addproducto">Add Producto</Link>
                </div>
            </nav>
        </div>
    );
}
